import React ,{useState} from 'react'


const Login = (props) => {
    const [credentials, setCredentials] = useState({email:"",password:""});
   
const handleSubmit= async (e)=>{
     e.preventDefault();
     const response = await  fetch(" http://localhost:8080/api/auth/login", {
        method: 'POST', 
        headers: {
          'Content-Type': 'application/json',
      },
      body: JSON.stringify({email:credentials.email, password:credentials.password}) 
    });
    const json = await response.json()
    console.log(json);
}
const onChange = (e) => {
    setCredentials({ ...credentials, [e.target.name]: e.target.value })
  }

  return (
    <div>


<form onSubmit={handleSubmit}>
  <div className="form-group">

    <label htmlFor="exampleInputEmail1">Email address</label>

    <input type="email" className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp"  value={credentials.email} onChange={onChange} placeholder="Enter email"/>

    <small id="emailHelp" className="form-text text-muted">We'll never share your email with anyone else.</small>

  </div>


  <div className="form-group">

    <label htmlFor="exampleInputPassword1">Password</label>

    <input type="password" className="form-control" value={credentials.password}  onChange={onChange}  id="exampleInputPassword1" placeholder="Password"/>

  </div>


  <button type="submit" className="btn btn-primary" >Submit</button>


</form>

    </div>
  )
}

export default Login
